import React from "react";
import ReactFullpage from "@fullpage/react-fullpage";
import "./FullPageStyles.css";

class FullpageWrapper extends React.Component {

  render() {
    return (
      <ReactFullpage
        scrollOverflow
        sectionsColor={["orange", "purple", "green", "blue", "pink", "black"]}
        menu={"#myMenu"}
        anchors={['firstPage', 'secondPage', 'thirdPage']}
        navigation
        navigationPosition={"right"}
        navigationTooltips={["Home", "About", "Resume", "Projects", "Photos", "Contact"]}
        // onLeave={this.onLeave.bind(this)}
        // afterLoad={this.afterLoad.bind(this)}
        render={({ state, fullpageApi }) => {
          return (
            <div id="fullpage-wrapper">
              <div className="section home-section">
                <h3>hi. i'm James.</h3>
              </div>
              <div className="section about-section">
                <div className="slide">
                  <h3>Slide 2.1</h3>
                </div>
                <div className="slide">
                  <h3>Slide 2.2</h3>
                </div>
                <div className="slide">
                  <h3>Slide 2.3</h3>
                </div>
              </div>
              <div className="section resume-section">
                <h3>Resume</h3>
              </div>
              <div className="section projects-section">
                <h3>Projects</h3>
              </div>
              <div className="section photos-section">
                <h3>Photos</h3>
              </div>
              <div className="section contact-section">
                <h3>Contact</h3>
                <button onClick={() => fullpageApi.moveTo(1, 0)}>
                  Move top
                </button>
              </div>
            </div>
          );
        }}
      />
    );
  }
}

export default FullpageWrapper;
